import { all, fork } from 'redux-saga/effects';
import { watchLoginApi } from './login';
import { watchContactsApi } from './contacts';

export default function* RootSaga() {
  yield all([fork(watchLoginApi)]);
  yield all([fork(watchContactsApi)]);
}
